import React, { useState, useEffect } from "react";
import axios from "axios";

const API_URL = "http://localhost:5000/api/it-programs";

const AdminItPrograms = () => {
  const [programs, setPrograms] = useState([]);
  const [form, setForm] = useState({
    title: "",
    icon: "",
    price: "",
    description: "",
    details: "",
    technologies: ""
  });
  const [editingId, setEditingId] = useState(null);

  // ✅ Fetch all programs
  useEffect(() => {
    fetchPrograms();
  }, []);

  const fetchPrograms = async () => {
    try {
      const res = await axios.get(API_URL);
      setPrograms(res.data);
    } catch (err) {
      console.error("Fetch error:", err);
    }
  };

  // ✅ Handle input change
  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  // ✅ Add / Update Program
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const payload = {
        ...form,
        technologies: form.technologies.split(",").map((t) => t.trim())
      };

      if (editingId) {
        // Update
        await axios.put(`${API_URL}/${editingId}`, payload);
        alert("Program updated ✅");
      } else {
        // Add
        await axios.post(API_URL, payload);
        alert("Program added ✅");
      }

      setForm({
        title: "",
        icon: "",
        price: "",
        description: "",
        details: "",
        technologies: ""
      });
      setEditingId(null);
      fetchPrograms();
    } catch (err) {
      console.error(err);
      alert("Error saving program ❌");
    }
  };

  // ✅ Edit Program (fill form with selected data)
  const handleEdit = (program) => {
    setEditingId(program._id);
    setForm({
      title: program.title,
      icon: program.icon,
      price: program.price,
      description: program.description,
      details: program.details,
      technologies: program.technologies.join(", ")
    });
  };

  // ✅ Delete Program
  const handleDelete = async (id) => {
    if (!window.confirm("Are you sure you want to delete this program?")) return;
    try {
      await axios.delete(`${API_URL}/${id}`);
      alert("Program deleted ✅");
      fetchPrograms();
    } catch (err) {
      console.error(err);
      alert("Error deleting program ❌");
    }
  };

  return (
    <div style={{ padding: "20px" }}>
      <h2>Admin - Manage IT Programs</h2>

      {/* Form */}
      <form onSubmit={handleSubmit} style={{ marginBottom: "20px" }}>
        <input name="title" placeholder="Title" value={form.title} onChange={handleChange} />
        <input name="icon" placeholder="Icon (emoji)" value={form.icon} onChange={handleChange} />
        <input name="price" placeholder="Price" value={form.price} onChange={handleChange} />
        <input name="description" placeholder="Description" value={form.description} onChange={handleChange} />
        <textarea name="details" placeholder="Details" value={form.details} onChange={handleChange}></textarea>
        <input name="technologies" placeholder="Technologies (comma separated)" value={form.technologies} onChange={handleChange} />
        <button type="submit">{editingId ? "Update Program" : "Add Program"}</button>
      </form>

      {/* List of programs */}
      <h3>Existing Programs</h3>
      <ul>
        {programs.map((p) => (
          <li key={p._id} style={{ marginBottom: "10px" }}>
            <strong>{p.icon} {p.title}</strong> - {p.price}
            <br />
            <small>{p.description}</small>
            <br />
            <button onClick={() => handleEdit(p)}>Edit</button>
            <button onClick={() => handleDelete(p._id)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default AdminItPrograms;
